import React, { useState, useEffect } from 'react';
import {
  Typography,
  Modal,
  CircularProgress,
  IconButton,
  makeStyles,
} from '@material-ui/core';
import HighlightOffIcon from '@material-ui/icons/HighlightOff';

export interface IBusTrackingModalProps {
  isOpen: boolean;
  closeModal: Function;
}

const useStyles = makeStyles((theme) => ({
  modalStyle: {
    justifyContent: 'center',
    alignItems: 'center',
    display: 'flex',
  },
  modalDiv: {
    overflow: 'auto',
    backgroundColor: 'white',
    width: '30%',
    height: '30%',
    borderRadius: '10px',
    flexDirection: 'column',
    justifyContent: 'start',
    alignItems: 'center',
    padding: 5,
  },
  exitButton: {
    position: 'absolute',
    right: '33%',
    top: '33%',
    backgroundColor: 'white',
    '&:hover': {
      background: 'white',
      transform: 'scale(1.15)',
    },
  },
  loadingLanguages: {
    position: 'absolute',
    width: '30%',
    height: '30%',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    marginTop: '10px',
  },
}));

const SOCKET_URL = 'http://localhost:8080/ws-chat/';

const BusTrackingModal: React.FC<IBusTrackingModalProps> = ({
  isOpen,
  closeModal,
}) => {
  const classes = useStyles();
  const [loading, setLoading] = useState<boolean>(true);

  useEffect(() => {}, []);
  return (
    <Modal
      disableBackdropClick={true}
      className={classes.modalStyle}
      open={isOpen}
    >
      <div className={classes.modalDiv}>
        {loading ? (
          <div className={classes.loadingLanguages}>
            <CircularProgress />
          </div>
        ) : (
          <>
            <Typography></Typography>
            <IconButton
              className={classes.exitButton}
              onClick={() => {
                closeModal();
              }}
            >
              <HighlightOffIcon fontSize='large' color='secondary' />
            </IconButton>
          </>
        )}
      </div>
    </Modal>
  );
};

export { BusTrackingModal };
